import React from "react";

const Winner = (props) =>{
    return(
        <div>
             <h1 style={{
            border: "1px ",
            height: "100px",
            width: "100%",
            display: "flex",
            justifyContent: "center",
            alignItems: "center"
          }}>{props.value} Won</h1>
          <button style={{
            border: "1px ",
            height: "100px",
            width: "100%",
            display: "flex",
            justifyContent: "center",
            alignItems: "center"
          }}>Reset</button>
        </div>
    )
}

export default Winner;
